export const agreementStyle = theme=>({
    container:{
        display:'flex',
        flexDirection:'column'
    },
    header:{
        display:'flex',
        flexDirection:'column',
        alignItems:'center',
    },
    mainRules:{
        display:'flex',
        flexDirection:'column',
        alignItems:'flex-start'
    },
    footer:{
        display:'flex',
        flexDirection:'row',
        justifyContent:"center",
        alignItems:'center'
    },
    button:{
        paddingLeft:25,
        paddingRight:25
    }
})

export default agreementStyle;
